import logging
import uuid
from enum import Enum, auto
from typing import Dict, List, Optional
from datetime import datetime


# Enums for status and roles
class SubmissionStatus(Enum):
    DRAFT = "Draft"
    SUBMITTED = "Submitted"
    PUBLISHED = "Published"
    REJECTED = "Rejected"


class UserRole(Enum):
    ADMIN = "Admin"
    DATA_SUBMITTER = "Data_Submitter"
    SUBMISSION_MANAGER = "Submission_Manager"
    VALIDATION_MANAGER = "Validation_Manager"
    DATA_MANAGER = "Data_Manager"
    TESTER = "Tester"
    UI_DESIGNER = "UI_Designer"


class FileType(Enum):
    CSV = "csv"
    JSON = "json"
    XML = "xml"


# Configure logging
def configure_logging(log_level: str = "INFO", log_file: Optional[str] = None):
    log_format = "%(asctime)s - %(levelname)s - %(message)s"
    logging.basicConfig(level=log_level, format=log_format, filename=log_file)


# Base classes
class User:
    def __init__(self, user_id: str, name: str, role: UserRole):
        self.user_id = user_id
        self.name = name
        self.role = role

    def __str__(self):
        return f"User({self.user_id}, {self.name}, {self.role})"


class ValidationRule:
    def __init__(self, rule_id: str, description: str, condition: callable):
        self.rule_id = rule_id
        self.description = description
        self.condition = condition

    def validate(self, data: Dict) -> bool:
        return self.condition(data)


class Submission:
    def __init__(self, submission_id: str, agency: str, status: SubmissionStatus = SubmissionStatus.DRAFT):
        self.submission_id = submission_id
        self.agency = agency
        self.status = status
        self.created_at = datetime.now()
        self.updated_at = datetime.now()

    def update_status(self, new_status: SubmissionStatus) -> bool:
        if self.status != new_status:
            self.status = new_status
            self.updated_at = datetime.now()
            return True
        return False

    def __str__(self):
        return f"Submission({self.submission_id}, {self.agency}, {self.status})"


class FABSSubmission(Submission):
    def __init__(self, submission_id: str, agency: str, flexible_fields: Dict, status: SubmissionStatus = SubmissionStatus.DRAFT):
        super().__init__(submission_id, agency, status)
        self.flexible_fields = flexible_fields


class DABSSubmission(Submission):
    def __init__(self, submission_id: str, agency: str, fpds_data: Dict, status: SubmissionStatus = SubmissionStatus.DRAFT):
        super().__init__(submission_id, agency, status)
        self.fpds_data = fpds_data


class Notification:
    def __init__(self, notification_id: str, message: str, recipient: str):
        self.notification_id = notification_id
        self.message = message
        self.recipient = recipient
        self.sent_at = datetime.now()

    def send(self) -> bool:
        logging.info(f"Notification sent to {self.recipient}: {self.message}")
        return True


class ValidationEngine:
    def __init__(self):
        self.rules: List[ValidationRule] = []

    def add_rule(self, rule: ValidationRule) -> None:
        self.rules.append(rule)

    def validate_submission(self, submission: Submission) -> List[str]:
        errors = []
        for rule in self.rules:
            if not rule.validate(submission.__dict__):
                errors.append(f"Validation failed: {rule.description}")
        return errors


class UIDesign:
    def __init__(self, design_id: str, design_name: str):
        self.design_id = design_id
        self.design_name = design_name
        self.last_updated = datetime.now()

    def update_design(self, new_design_name: str) -> None:
        self.design_name = new_design_name
        self.last_updated = datetime.now()


class TestReport:
    def __init__(self, report_id: str, tester: str, results: Dict):
        self.report_id = report_id
        self.tester = tester
        self.results = results
        self.generated_at = datetime.now()

    def generate_report(self) -> Dict:
        return {
            "report_id": self.report_id,
            "tester": self.tester,
            "results": self.results,
            "generated_at": self.generated_at
        }


class FileGenerator:
    @staticmethod
    def generate_d_file(submission: Submission, file_type: FileType) -> str:
        file_name = f"D_{submission.submission_id}.{file_type.value}"
        logging.info(f"Generated file: {file_name}")
        return file_name


class FileValidator:
    @staticmethod
    def validate_file_extension(file_name: str, allowed_extensions: List[FileType]) -> bool:
        extension = file_name.split('.')[-1].lower()
        return any(ext.value.lower() == extension for ext in allowed_extensions)


class DataProcessor:
    @staticmethod
    def delete_data(data_id: str) -> bool:
        logging.info(f"Data with ID {data_id} has been deleted.")
        return True


class DataManager:
    @staticmethod
    def sync_d1_file_with_fpds(fpds_data: Dict) -> bool:
        logging.info("D1 file synced with FPDS data.")
        return True


class HistoricalDataLoader:
    @staticmethod
    def load_fabs_data(required_columns: List[str]) -> List[Dict]:
        logging.info(f"Loaded FABS data with columns: {required_columns}")
        return [{"data": "sample", "columns": required_columns}]

    @staticmethod
    def load_fpds_data(years: List[int]) -> List[Dict]:
        logging.info(f"Loaded FPDS data for years: {years}")
        return [{"year": year, "contracts": []} for year in years]


class NotificationManager:
    def __init__(self):
        self.notifications = []

    def send_notification(self, message: str, recipient: str) -> bool:
        notification = Notification(str(uuid.uuid4()), message, recipient)
        success = notification.send()
        if success:
            self.notifications.append(notification)
        return success


# Example usage
def main():
    configure_logging()

    # Create users
    admin = User("u1", "Admin User", UserRole.ADMIN)
    submitter = User("u2", "Data Submitter", UserRole.DATA_SUBMITTER)

    # Create submissions
    fabs_submission = FABSSubmission("sub1", "Agency1", {"field1": "value1"})
    dabs_submission = DABSSubmission("sub2", "Agency2", {"contract_id": "c123"})

    # Update submission status
    dabs_submission.update_status(SubmissionStatus.SUBMITTED)

    # Validate submissions
    validation_engine = ValidationEngine()
    validation_engine.add_rule(ValidationRule("r1", "Agency must not be empty", lambda data: bool(data.get("agency"))))
    validation_errors = validation_engine.validate_submission(fabs_submission)
    print(f"Validation errors: {validation_errors}")

    # Generate D file
    d_file = FileGenerator.generate_d_file(dabs_submission, FileType.CSV)
    print(f"Generated file: {d_file}")

    # Send notification
    notification_manager = NotificationManager()
    notification_manager.send_notification("Your submission has been processed.", "Agency1")


if __name__ == "__main__":
    main()
